import React, { Component } from "react";
import "./Profile.style.css";
import Bio from "./Bio";
import Skills from "./Skills";
import SocialLinks from "./SocialLinks";

export default class Profile extends Component {
  person = {
    name: "Sabuj Abir",
    title:
      "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Natus, voluptatem?",
    skillA: "JavaScript",
    skillB: "WordPress",
    skillC: "ReactJS",
    social: [
      {
        mediaName: "Facebook",
        link: "www.facebook.com",
      },
    ],
  };

  render() {
    return (
      <div className="profile">
        <Bio name={this.person.name} title={this.person.title} />
        <Skills
          skillA={this.person.skillA}
          skillB={this.person.skillB}
          skillC={this.person.skillC}
        />
        <SocialLinks
          mediaName={this.person.social1.mediaName}
          link={this.person.social1.link}
        />
      </div>
    );
  }
}
